import React from 'react'
import Navbar from '../components/NavigationBar/Navbar'
import Footer from '../components/Footer/Footer'
import ImageComponent from '../components/ImageComponent/ImageComponent'
import ValorsImatge from '../images/backgroundImageAraSi.jpg'
import ValorsLayout from '../components/ValorsLayout/ValorsLayout';
import {CenteredColoredBox} from '../components/ColoredBox/ColoredBox';
const Valors = () => {

  const boxes = [
    { width: '480px', height: '1320px', backgroundColor: '#DADADA', text: "Pastorets de Girona, una tradició" },
    { width: '480px', height: '400px', backgroundColor: '#54FF45', text: "Pastorets ha estat la porta d'entrada al món del teatre d'actors, actrius i tècnics que després han fet el pas al món professional i una escola per a generacions d'aficionats al món del teatre" },
    { width: '480px', height: '400px', backgroundColor: '#dedc57', text: 'Els nous Pastorets continuaran essent de caire familiar i musical amb un format diferent, inclusiu i innovador.' },
  ];

  return (
    <div>
      <Navbar />
      <ImageComponent src={ValorsImatge} alt="Valors" text="Valors" />
      <ColumnLayout boxes={boxes}  centered={false}/>

      <Footer />
    </div>
  )
}

export default Valors
